import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
    <div class="container">
    <div class="row">
    <div class="col-md-6">
    <button type="button" class="btn btn-outline-primary">Scanner QR</button>

    </div>
    <div class="col-md-6">
    <button type="button" class="btn btn-outline-success">Consultas</button>

    </div>
    </div>
    </div>
    </div>
  );
}

export default App;
